// Profile.js
import React from 'react';

function Profile() {
  return (
    <section>
      <h2>Profile</h2>
      <ul>
        <li><strong>名前：</strong>富田愛惟</li>
        <li><strong>生年月日：</strong>2002年6月2日</li>
        <li><strong>学歴：</strong>2025年3月～　白梅学園大学 子ども学部子ども学科 卒業</li>
        <li><strong>職歴：</strong>2025年4月～現在　保育士</li>
        <li><strong>現在：</strong>フロントエンドエンジニアを目指して独学で勉強中</li>
      </ul>
    </section>
  );
}

export default Profile;
